import React from 'react';
import {SwRoute} from 'react-router-dom';
import './App.css';
import HomePage from '../src/pages/homepage'

const HatsPage = ()=>{
  <div>
    <h1>
      HatsPage
    </h1>
  </div>
}

function App() {
  return (
    <div>
      <Route exact path="/" component = {HomePage} />
    </div>
  );
}

export default App;
